PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?paper ?venue WHERE {
  ?paper dblp:title "Principles and Implementation of Deductive Parsing." .
  ?paper dblp:publishedInStream ?venue .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?venue ?venueLabel WHERE {
  VALUES ?author {
    <https://dblp.org/pid/19/2932-1> <https://dblp.org/pid/55/2484-1> <https://dblp.org/pid/40/4160> <https://dblp.org/pid/236/3060> <https://dblp.org/pid/40/4731>
  }
  ?pub dblp:authoredBy ?author .
  FILTER ( ?pub != <https://dblp.org/rec/conf/fgcn/ChenZXSS08> ) ?pub dblp:publishedInStream ?venue .
  OPTIONAL {
    ?venue rdfs:label ?venueLabel
  }
}
ORDER BY ?venue

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?paper ?title WHERE {
  ?paper dblp:authoredBy <https://dblp.org/pid/63/10539> .
  OPTIONAL {
    ?paper rdfs:label ?title
  }
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?paper ?title ?venue ?venueLabel WHERE {
  ?paper dblp:author <https://dblp.org/pid/64/490> .
  ?paper rdfs:label ?title .
  OPTIONAL {
    ?paper dblp:publishedIn ?venue .
    OPTIONAL {
      ?venue rdfs:label ?venueLabel
    }
  }
  FILTER ( ( BOUND( ?venueLabel ) && ( CONTAINS( LCASE( STR( ?venueLabel ) ) , "corr" ) || CONTAINS( LCASE( STR( ?venueLabel ) ) , "spring" ) ) ) )
}
ORDER BY ?venueLabel ?title

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( COUNT( DISTINCT ?paper ) AS ?count ) WHERE {
  ?paper dblp:authoredBy <https://dblp.org/pid/21/4802>
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?paper ?numCreators WHERE {
  VALUES ?paper {
    <https://dblp.org/rec/journals/tcyb/MaB21> <https://dblp.org/rec/conf/etfa/Missal0H07>
  }
  ?paper dblp:numberOfCreators ?numCreators .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT DISTINCT ?coauthor ?coauthorName ?affiliation ?pub ?year WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/286/6829> .
  {
    ?pub dblp:yearOfPublication ?year .
  } UNION {
    ?pub dblp:yearOfEvent ?year .
  }
  FILTER ( ?year >= 2022 ) ?pub dblp:authoredBy ?coauthor .
  FILTER ( ?coauthor != <https://dblp.org/pid/286/6829> ) OPTIONAL {
    ?coauthor dblp:creatorName ?coauthorName
  }
  OPTIONAL {
    ?coauthor dblp:affiliation ?affiliation
  }
}
ORDER BY DESC ( ?year )

