SELECT ( COUNT( ?paper ) AS ?totalPapers ) ( MIN( xsd:integer ( STR( ?year ) ) ) AS ?earliestYear ) ( MAX( xsd:integer ( STR( ?year ) ) ) AS ?latestYear ) ( ( MAX( xsd:integer ( STR( ?year ) ) ) - MIN( xsd:integer ( STR( ?year ) ) ) + 1 ) AS ?numYears ) ( COUNT( ?paper ) / ( MAX( xsd:integer ( STR( ?year ) ) ) - MIN( xsd:integer ( STR( ?year ) ) ) + 1 ) AS ?avgPapersPerYear ) WHERE {
  ?paper dblp:createdBy <https://dblp.org/pid/45/1135> .
  ?paper dblp:yearOfPublication ?year .
}

